/*create database db_clicknpick;*/

use db_clicknpick;

drop table user;
drop table product;
drop table orders;
drop table coupons;
drop table donations;
drop table geolocation;

CREATE TABLE `orders` (
  `id` VARCHAR(30) NOT NULL,
  `fk_product_ids` varchar(45) NOT NULL,
  `fk_user_name` VARCHAR(45) DEFAULT NULL,
  `shipping_address_1` varchar(100) DEFAULT NULL,
  `shipping_address_2` varchar(100) DEFAULT NULL,
  `city` varchar(45) DEFAULT NULL,
  `state` varchar(45) DEFAULT NULL,
  `zip` varchar(45) DEFAULT NULL,
  `country` varchar(45) DEFAULT NULL,
  `phone` varchar(45) DEFAULT NULL,
  `order_date` datetime DEFAULT NULL,
  `expected_delivery_date` datetime DEFAULT NULL,
  `card_number` varchar(45) DEFAULT NULL,
  `card_expiry_date` varchar(45) DEFAULT NULL,
  `CVV` varchar(45) DEFAULT NULL,
  `name_on_card` varchar(45) DEFAULT NULL,
  `order_amount` double DEFAULT NULL,
  `flag_donated` varchar(1) DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE `product` (
  `id` int(11) NOT NULL,
  `name` varchar(45) NOT NULL,
  `description` varchar(255),
  `category` varchar(45) NOT NULL,
  `type` varchar(45) NOT NULL,
  `price` double NOT NULL,
  `manufacturer` varchar(45) DEFAULT NULL,
  `discount` int(11) DEFAULT NULL,
  `condition` varchar(45) DEFAULT NULL,
  `image` varchar(100) DEFAULT NULL,
  `gender` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `user` (
  `username` varchar(45) NOT NULL,
  `title` varchar(5) NOT NULL,
  `first_name` varchar(45) NOT NULL,
  `last_name` varchar(45) NOT NULL,
  `email_id` varchar(45) NOT NULL,
  `password` varchar(45) NOT NULL,
  `date_of_birth` date DEFAULT NULL,
  `address_1` varchar(100) NOT NULL,
  `address_2` varchar(100) DEFAULT NULL,
  `city` varchar(45) NOT NULL,
  `state` varchar(45) NOT NULL,
  `zip` varchar(45) DEFAULT NULL,
  `country` varchar(45) DEFAULT NULL,
  `phone` varchar(45) DEFAULT NULL,
  `role` varchar(45) NOT NULL,
  PRIMARY KEY (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `coupons` (
  `coupon_code` varchar(10) NOT NULL,
  `discount` varchar(5) NOT NULL,
  `user_name` varchar(100) NOT NULL,
  `is_used` varchar(4) NOT NULL,
  PRIMARY KEY (`coupon_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE `donations` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `username` VARCHAR(45) NULL,
  `organization` VARCHAR(45) NULL,
  `quantity` VARCHAR(45) NULL,
  `pickup_location` VARCHAR(45) NULL,
  `pickup_date` VARCHAR(45) NULL,
  PRIMARY KEY (`id`))
COMMENT = 'To store he donation details user wise';

CREATE TABLE `geolocation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `zipcode` varchar(45) DEFAULT NULL,
  `city` varchar(45) DEFAULT NULL,
  `state` varchar(45) DEFAULT NULL,
  `country` varchar(45) DEFAULT NULL,
  `region` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15145 DEFAULT CHARSET=utf8;

